import styled from "styled-components";

const Container = styled("div")`
width: 100vw:
height: 300px;
background-color: white;


margin-top: 100px;
padding: 20px 0 10px 30px;
`

const Roadmap = () => {
    return (
        <Container>
            <h1>
                Roadmap
            </h1>
        </Container>
    )
}

export default Roadmap;
